function CommodityConfig.GetConfig(key)
	local tb = CommodityConfig.Values[key]
	if not tb then
		print_error(key)
		return nil
	end
	local config = {["id"] = 1,["commodityid"] = 2,["commodityname"] = 3,["itemcontent"] = 4,["boxdes"] = 5,["itemid"] = 6,["costkind"] = 7,["costqty"] = 8,["discount"] = 9,["ajustedprice"] = 10,["costlevel"] = 11,["enabletime"] = 12,["disabletime"] = 13,["upperlimit"] = 14,["hot"] = 15,["starttime"] = 16,["endtime"] = 17,["fix"] = 18,["random"] = 19,["payid"] = 20,["sort"] = 21,["next"] = 22,["prepose"] = 23,["buylimit"] = 24,["reddot"] = 25,["itemtype"] = 26,["appear"] = 27,["nazo"] = 28,}
	for k,v in pairs(config) do
		config[k] = tb[v]
	end
	return config 
end
return CommodityConfig